import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ViewGoods() {
  const [scannedData, setScannedData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/api/scanned-data'); // Replace with your API endpoint
        setScannedData(response.data);
      } catch (error) {
        console.error('Error fetching scanned data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <table>
        <thead>
          <tr>
            {/* Table headers based on scanned data structure */}
          </tr>
        </thead>
        <tbody>
          {scannedData.map((item, index) => (
            <tr key={index}>
              {/* Table cells based on scanned data properties */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ViewGoods;
